(23, '2024-08-22 17:22:59', 'Shilpa Joshi', 'shilpaabhi288@gmail.com', 'Paid', 'NLF-copy', 'Email address', 18, '+919638800006', '0', NULL, NULL, 'Follow-up', '2024-08-23', '01:00:00', 'b2b', '<!DOCTYPE html>\r\n<html lang=\"en\">\r\n<head>\r\n    <meta charset=\"UTF-8\">\r\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\">\r\n    <title>Lead Action</title>\r\n    <link rel=\"stylesheet\" href=\"css/lead_action.css\">\r\n    <script>\r\ndocument.addEventListener(\"DOMContentLoaded\", function() {\r\n    const followupDateInput = document.getElementById(\'followup_date\');\r\n    const followupTimeInput = document.getElementById(\'followup_time\');\r\n    const progressSelect = document.getElementById(\'progress\');\r\n    \r\n    // Set up current date and max date\r\n    const today = new Date();\r\n    const maxDate = new Date();\r\n    maxDate.setDate(today.getDate() + 2);\r\n\r\n    // Format date as YYYY-MM-DD\r\n    function formatDate(date) {\r\n        const year = date.getFullYear();\r\n        const month = (\'0\' + (date.getMonth() + 1)).slice(-2);\r\n        const day = (\'0\' + date.getDate()).slice(-2);\r\n        return `${year}-${month}-${day}`;\r\n    }\r\n\r\n    // Set min and max date for follow-up date input\r\n    followupDateInput.min = formatDate(today);\r\n    followupDateInput.max = formatDate(maxDate);\r\n\r\n    // Handle progress selection change\r\n    progressSelect.addEventListener(\'change\', function() {\r\n        const selectedProgress = this.value;\r\n        if (selectedProgress === \'First Call Done\') {\r\n            // Disable follow-up time input if it\'s more than 2 hours from now\r\n            const now = new Date();\r\n            followupTimeInput.disabled = false;\r\n            followupDateInput.addEventListener(\'change\', function() {\r\n                const followupDate = new Date(followupDateInput.value);\r\n                if (followupDate.toDateString() === today.toDateString()) {\r\n                    followupTimeInput.disabled = false;\r\n                } else {\r\n                    followupTimeInput.disabled = true;\r\n                }\r\n            });\r\n        } else {\r\n            followupTimeInput.disabled = false;\r\n        }\r\n    });\r\n});\r\n</script>\r\n</head>\r\n<body>\r\n    <div class=\"lead-action-container\">\r\n        <h2>Update Lead Progress</h2>\r\n\r\n        <?php if ($success): ?>\r\n        <div class=\"success\"><?php echo htmlspecialchars($success); ?></div>\r\n        <?php endif; ?>\r\n\r\n        <?php if (!empty($errors)): ?>\r\n        <div class=\"errors\">\r\n            <ul>\r\n                <?php foreach ($errors as $error): ?>\r\n                <li><?php echo htmlspecialchars($error); ?></li>\r\n                <?php endforeach; ?>\r\n            </ul>\r\n        </div>\r\n        <?php endif; ?>\r\n        <?php if (!$is_admin): ?>\r\n        <form action=\"lead_action.php<?php echo ($lead_id) ? \'?id=\' . urlencode($lead_id) : \'\'; ?>\" method=\"post\"\r\n            enctype=\"multipart/form-data\">\r\n            <label for=\"progress\">Progress:</label>\r\n            <select name=\"progress\" id=\"progress\" required>\r\n                <option value=\"Not Started\" <?php echo ($lead[\'progress\'] == \'Not Started\') ? \'selected\' : \'\'; ?>>Not\r\n                    Started</option>\r\n                <option value=\"Follow-up\" <?php echo ($lead[\'progress\'] == \'Follow-up\') ? \'selected\' : \'\'; ?>>Follow-up\r\n                </option>\r\n                <option value=\"Buys\" <?php echo ($lead[\'progress\'] == \'Buys\') ? \'selected\' : \'\'; ?>>Buys</option>\r\n                <option value=\"Converted\" <?php echo ($lead[\'progress\'] == \'Converted\') ? \'selected\' : \'\'; ?>>Converted\r\n                </option>\r\n                <option value=\"Lost\" <?php echo ($lead[\'progress\'] == \'Lost\') ? \'selected\' : \'\'; ?>>Lost</option>\r\n                <option value=\"Didn\'t Connect\" <?php echo ($lead[\'progress\'] == \'Didnt Connect\') ? \'selected\' : \'\'; ?>>\r\n                    Didn\'t Connect</option>\r\n                <option value=\"First Call Done\"\r\n                    <?php echo ($lead[\'progress\'] == \'First Call Done\') ? \'selected\' : \'\'; ?>>\r\n                    First Call Done</option>\r\n                <option value=\"Quote Sent\" <?php echo ($lead[\'progress\'] == \'Quote Sent\') ? \'selected\' : \'\'; ?>>Quote\r\n                    Sent</option>\r\n                <option value=\"Not Interested\" <?php echo ($lead[\'progress\'] == \'Not Interested\') ? \'selected\' : \'\'; ?>>\r\n                    Not Interested</option>\r\n                <!-- Add other options as needed -->\r\n            </select>\r\n\r\n            <label for=\"category\">Category:</label>\r\n            \r\n            <select name=\"category\" id=\"category\" required>\r\n                <option value=\"B2B\" <?php echo ($lead[\'category\'] == \'B2B\') ? \'selected\' : \'\'; ?>>B2B</option>\r\n                <option value=\"B2C\" <?php echo ($lead[\'category\'] == \'B2C\') ? \'selected\' : \'\'; ?>>B2C</option>\r\n                <!-- Add other categories as needed -->\r\n            </select>\r\n\r\n            <label for=\"note\">Note:</label>\r\n            <textarea name=\"note\" id=\"note\" rows=\"4\" required><?php echo htmlspecialchars($lead[\'note\']); ?></textarea>\r\n\r\n            <label for=\"followup_date\">Follow-up Date:</label>\r\n            <input type=\"date\" name=\"followup_date\" id=\"followup_date\" value=\"<?php echo ($lead[\'progress\'] == \'First Call Done\') ? date(\'Y-m-d\') : htmlspecialchars($lead[\'followup_date\']); ?>\">\r\n\r\n            <label for=\"followup_time\">Follow-up Time:</label>\r\n            <input type=\"time\" name=\"followup_time\" id=\"followup_time\" value=\"<?php echo htmlspecialchars($lead[\'followup_time\']); ?>\">\r\n\r\n            <label for=\"file\">Upload Payment Screenshot/Audio Recording:</label>\r\n            <input type=\"file\" name=\"file\" id=\"file\">\r\n\r\n            <?php if ($lead[\'progress\'] == \'Converted\'): ?>\r\n            <label for=\"converted_price\">Converted Price:</label>\r\n            <input type=\"text\" name=\"converted_price\" id=\"converted_price\"\r\n                value=\"<?php echo htmlspecialchars($lead[\'converted_price\']); ?>\">\r\n\r\n            <label for=\"conversion_date\">Conversion Date:</label>\r\n            <input type=\"date\" name=\"conversion_date\" id=\"conversion_date\"\r\n                value=\"<?php echo htmlspecialchars($lead[\'conversion_date\']); ?>\">\r\n            <?php endif; ?>\r\n\r\n            <button type=\"submit\" name=\"update_progress\">Update Progress</button>\r\n        </form>\r\n\r\n        <h3>Timeline/Logs</h3>\r\n        <ul class=\"timeline\">\r\n            <?php foreach ($timeline as $log): ?>\r\n            <li>\r\n                <strong><?php echo htmlspecialchars($log[\'created_at\']); ?>:</strong>\r\n                <p><?php echo htmlspecialchars($log[\'note\']); ?></p>\r\n                <?php if (!empty($log[\'file_path\'])): ?>\r\n                <p>File: <a href=\"<?php echo htmlspecialchars($log[\'file_path\']); ?>\" target=\"_blank\">View File</a></p>\r\n                <?php endif; ?>\r\n                <?php if (!empty($log[\'progress\'])): ?>\r\n                <p>Progress: <?php echo htmlspecialchars($log[\'progress\']); ?></p>\r\n                <?php endif; ?>\r\n            </li>\r\n            <?php endforeach; ?>\r\n        </ul>\r\n        <?php endif; ?>\r\n    </div>\r\n</body>\r\n</html>', NULL, NULL, NULL, NULL, NULL, NULL, '2024-08-17 16:07:26'),
